import Vue from 'vue';
import Vuex from 'vuex';
import { uuid } from "vue-uuid";

Vue.use(Vuex);

export default new Vuex.Store({
    state: {
        ElementData: {},
        LinkData: {},
        openProjectIndex: 0,
        navigatorList: [],
        LSOPProject: [],
        // [{
        //     id: 1,
        //     name: null,
        //     DataTypes: {},
        //     Service: {
