        //                 name: 'TestService01',
        //                 namespace: 'bns/rd',
        //                 version: '1.0',
        //                 events: [
        //                     { name: 'Event_33', type: 'ByteArray' },
        //                     { name: 'Event_12', type: 'String' },
        //                     { name: 'Event_13', type: 'String' },
        //                 ],
        //                 fields: [
        //                     { name: 'Field_11', type: 'bool', getter: 'true', setter: 'false', notifier: 'false' },
