        //                 ],
        //                 methods: [
        //                     { name: 'Method_11', arguments: 'IN_Arg1_int32', fireforget: 'false', perrorset: 'ApAppError_10', perrors: 'ApAppError_10', description: '' },
        //                     { name: 'Method_12', arguments: 'IN_Arg1_int32,IN_Arg2_uint32', fireforget: 'false', perrorset: 'ApAppError_10', perrors: 'ApAppError_10', description: '' },

        //                 ],
        //             },
        //             {
        //                 name: 'TestService02',
        //                 namespace: 'bns/rd',
        //                 version: '1.0',
        //                 events: [
        //                     { name: 'Event_41', type: 'ByteArray' },
