        //                     { name: 'Event_13', type: 'String' },
        //                 ],
        //                 fields: [
        //                     { name: 'Field_11', type: 'bool', getter: 'true', setter: 'false', notifier: 'false' },
        //                     { name: 'Field_12', type: 'bool', getter: 'true', setter: 'false', notifier: 'true' },
        //                 ],
        //                 methods: [
        //                     { name: 'Method_11', arguments: 'IN_Arg1_int32', fireforget: 'false', perrorset: '', perrors: '', description: '' },
        //                     { name: 'Method_12', arguments: 'IN_Arg1_int32,IN_Arg2_uint32', fireforget: 'false', perrorset: '', perrors: '', description: '' },

        //                 ],
        //             }
        //         ],
        //         SomeIPDe: [],
        //         SomeIOIn: []
        //     },
        //     Machine: {
        //         Machines: [],
        //         MachineDesigns: [],
        //         EthernetCluster: [],
        //         Sstems: []
        //     },
        //     AdaptiveApplication: {
        //         SWComponents: [],
        //         Process: [],
        //         Executable: []
        //     },
        //     Platform: {},
        // }],
    },
    getters: {
        numProject(state) {
            return state.LSOPProject.lenght;
        },
    },
    mutations: {
        saveOpenProject(state, payload) {
            state = payload
        },
        selectOpenProject(state, payload) {
            state.openProjectIndex = payload.openProjectIndex
        },
        AddProject(state, payload) {
            state.LSOPProject.push({
                name: payload.name,
                DataTypes: { CompuMethod: [], DataConstr: [], ApplicationArrayDataType: [], ImplementationDataType: [] },
                Service: {
                    ServiceInterface: [],
                    SomeIPServiceInterfaceDeployment: [],
                    SomeIPServerEvent: [],
                    SomeIPClientEvent: [],
                    ErrorDomain: [],
                    Error: [],
                    ErrorSet: [],
                    SomeIPClientServiceInstance: [],
                    SomeIPServerServiceInstance: [],
                    SomeIPServiceInstanceToMachine: [],
                    ServiceInstanceToPortPrototype: [],
                    RequiredSomeIP: [],
                    ProvidedSomeIP: []
                },
                Machine: { Machines: [], MachineDesigns: [], EthernetCluster: [], ModeDeclarationGroup: [], HWElement: [], HWCategoty: [] },
                AdaptiveApplication: { ProToMachMapping: [], SWComponents: [], Process: [], Executable: [], StartupConfig: [], DeterministicClient: [] },
                Platform: {}
            })
        },
        AddTreeView(state, payload) {
            state.navigatorList.push({
                name: payload.name,
                children: [{
                        name: 'DataTypes',
                        id: 1,
                        children: [
                            { name: 'Compu Method', children: [] },
                            { name: 'Data Constr', children: [] },
                            { name: 'Application Array', children: [] },
                            { name: 'Implementation', children: [] },
                        ]
                    },
                    {
                        name: 'Service',
                        id: 1,
                        children: [{
                                name: 'Service Interfaces',
                                id: 1,
                                children: [{ name: 'SomeIP Service Interface Deployment', children: [] },
                                    { name: 'Service Interface', children: [] }
                                ]
                            },
                            {
                                name: 'SomeIPEvents',
                                id: 1,
                                children: [{ name: 'Client', children: [] },
                                    { name: 'Server', children: [] },
                                ]
                            },
                            {
                                name: 'Service Instances',
                                id: 1,
                                children: [{ name: 'SomeIP Client', children: [] },
                                    { name: 'SomeIP Server', children: [] },
                                    { name: 'SomeIP To Machine Mapping', children: [] },
                                    { name: 'To Port Prototype Mapping', children: [] },
                                    { name: 'Required SomeIP', children: [] },
                                    { name: 'Provided SomeIP', children: [] },
                                ]
                            },
                            {
                                name: 'Errors',
                                id: 1,
                                children: [{ name: 'Error', children: [] },
                                    { name: 'Error Set', children: [] },
                                    { name: 'Error Domain', children: [] },
                                ]
                            },
                        ]
                    },
                    {
                        name: 'Adaptive Application',
                        id: 1,
                        children: [
                            { name: 'Process to Machine Mapping', children: [] },
                            { name: 'SW Components', children: [] },
                            { name: 'Process', children: [] },
                            { name: 'Process Design', children: [] },
                            { name: 'Executable', children: [] },
                            { name: 'Startup Config', children: [] },
                            { name: 'Deterministic Client', children: [] }
                        ]
                    },
                    {
                        name: 'Machines',
                        id: 1,
                        children: [
                            { name: 'Machines', children: [] },
                            { name: 'Machine Designs', children: [] },
                            { name: 'Ethernet Cluster', children: [] },
                            { name: 'Mode Declaration Group', children: [] },
                            { name: 'HW Element', children: [] },
                            { name: 'HW Categoty', children: [] }
                        ]
                    },
                    {
                        name: 'Platform',
                        id: 1,
                        children: []
                    }
                ]
            })
        },
        AddBoardItem: (state, _value) => {
            var newUUid = uuid.v1();
            _value.uuid = newUUid;
            _value.links = []; // add the links array
            Vue.set(state.ElementData, newUUid, _value);
            localStorage.setItem("store", JSON.stringify(state));
        },
        AddLink: (state, _value) => {
            var newUUid = uuid.v1();

            Vue.set(state.LinkData, newUUid, _value);
            state.ElementData[_value.start].links.push(newUUid);
            state.ElementData[_value.end].links.push(newUUid);
            localStorage.setItem("store", JSON.stringify(state));
        },
        initialiseStore(state) {
            if (localStorage.getItem("store")) {
                this.replaceState(
                    Object.assign(state, JSON.parse(localStorage.getItem("store")))
                );
            }
        }
    },
    actions: {}
});
